import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <footer className="footer-section">
      <div className="footer-content">
        <h2 className="footer-title">
          Join 100K+ Taxpayers <br /> Who Filed Smarter
        </h2>
        <div className="footer-buttons">
          <button className="btn primary-btn">File ITR Now</button>
          <button className="btn secondary-btn">Talk to Operator Advisor</button>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
